# Calculate and print the area of the rectangles
print(rectangle1.get_area())  # Output: 15
print(rectangle2.get_area())  # Output: 14

# Calculate and print the perimeter of the rectangles
print(rectangle1.get_perimeter())  # Output: 16
print(rectangle2.get_perimeter())  # Output: 18

