"""**with the super method:** super does not refer to the parent class. It refers to the next class in the mro list, which depends on the actual class being instantiated. So when calling super().__init__, the actual method called is undetermined from the calling frame. so to instantiate the next parent constructor, another super will be called but this time it will take argument of the current parent constructor and the self argument"""

# some parent classes
class Person:

    def __init__(self, name, age, gender):
        self.name = name
        self.age = age
        self.gender = gender

    def greet(self):
        print(f'Hello world! My name is {self.name}')


class Company:

    def __init__(self, company_name='Unknown'):
        self.company_name = company_name

    def description(self):
        print(f'I am an employee of {self.company_name}')


class Employee(Person, Company):

    def __init__(self, name, age, gender, company_name):
        super().__init__(name, age, gender)
        self.company_name = company_name
        self.employee_id = self._generate_employee_id()
        self.salary = self._calculate_salary()
        print(f"I am an employee with ID {self.employee_id} and a salary of {self.salary}.")

    def _generate_employee_id(self):
        # Add your logic to generate an employee ID
        return "EMP001"

    def _calculate_salary(self):
        # Add your logic to calculate the employee's salary
        return 5000

emp1 = Employee('John', 30, 'Male', 'Sabudh Foundation')
emp1.description()
emp1.greet()

"""it's still a repetitive task to take care of the order calling and keep an eye out that every constructor has been called properly that's where mixin comes in. the mixin will automatically call the 2nd constructor for us. Since we only have to call a single constructor this time, we can do so with super to avoid having to hard-code the parent class's name."""

# some parent classes
class Person:

    def __init__(self, name, age, gender, *args, **kwargs):
        super().__init__(**kwargs)
        self.name = name
        self.age = age
        self.gender = gender

    def greet(self):
        print(f'Hello world! my name is {self.name}')


class Company:

    def __init__(self, company_name='Unknown', *args, **kwargs):
        super().__init__(**kwargs)
        self.company_name = company_name

    def description(self):
        print(f'I am an employee of {self.company_name}')

class Employee(Person, Company):

    def __init__(self, name, age, gender, company_name):
        # pass all arguments on as keyword
        # arguments to avoid problems with
        # positional arguments and the order
        # of the parent classes
        super().__init__(
            name=name,
            age=age,
            gender=gender,
            company_name=company_name
        )

emp1 = Employee('John', 30, 'Male', 'Sabudh Foundation')
emp1.description()
emp1.greet()

Company.mro()

"""### Is-a versus has-a relationships

An **IS-A relationship** is inheritance. The classes which inherit are known as sub classes or child classes. child classes are a type of parent class. For example, an apple is a fruit. So you will extend fruit to get apple.

A **HAS-A relationship** is composition, composition means creating instances which have references to other objects. For example, a room has a table. So you will create a class room and then in that class create an instance of type table.
"""

