# @title
class Shape:
    def __init__(self, color, filled):
        self.color = color
        self.filled = filled

    def get_color(self):
        return self.color

    def is_filled(self):
        return self.filled


class Circle(Shape):
    def __init__(self, color, filled, radius):
        super().__init__(color, filled)
        self.radius = radius

    def get_area(self):
        return 3.14 * self.radius ** 2


class Rectangle(Shape):
    def __init__(self, color, filled, length, width):
        super().__init__(color, filled)
        self.length = length
        self.width = width

    def get_area(self):
        return self.length * self.width


