"""## Abstraction

Abstraction provides a programmer to hide all the irrelevant data/process of an application in order to reduce complexity and increase the efficiency of the program.

**Abstract Class**: is a class which has at least one abstract method or property (a method which is defined but not implemented, these methods generally contains a pass statement, every subclass of the base class will ride this method with it's implementation). Python provides the abc module to use the abstraction in the Python
"""

from abc import ABC, abstractmethod

# Polygon will inherit from the base class ABC
class Polygon(ABC):

    @abstractmethod
    def process(self):
        pass

obj = Polygon()

"""We can't create an object from abstract class"""

class Polygon(ABC):

    @abstractmethod
    def area(self):
        pass


# implement abstract method in child class
class Rectangle(Polygon):

    def area(self):
        print('calculating area!')

obj = Rectangle()
obj.area()

# A class that is derived from an abstract class cannot be instantiated,
# unless all of its abstract methods are overridden.
class Rectangle(Polygon):
    pass

obj = Rectangle()
obj.area()

# a complete example
# a polygon has an area and perimeter, since every polygon has different,
# implementation to calculate area and perimeter, our base class will have these,
# function but the programmer has to override them so each will have it's own logic.
# as you can see we are only defining the methods and not implementing them.
class Polygon(ABC):

    @abstractmethod
    def area(self):
        pass

    @abstractmethod
    def perimeter(self):
        pass

# if we don't override all methods python will raise a TypeError,
# while instantiating them, this makes easier for a programmer to understand,
# what kind of method he/she needs to implement to properly write the implementation,
# and not encounter an error while creating an object.
class Rectangle(Polygon):

    def area(self):
        print('calculating area!')

obj = Rectangle()
obj.area()

class Rectangle(Polygon):

    def area(self):
        print('calculating area!')

    def perimeter(self):
        print('calculating perimeter!')

obj = Rectangle()
obj.perimeter()

