"""## Encapsulation

the idea of encapsulation is to hide the information of an attribute from the end user so that the object has always has a valid state. For e.g., A polygon must have a mininum of 3 straight sides and angles to be called a polygon. we can create an attribute that states the minimum number of sides of our base class but we don't want the end-user to change this behaviour, we can use the acccess modifiers to peform this task

the three type of access specifiers helps us performing encapsulation in python
* Public Members (attribute): attritbutes can be accessed anywhere
* Protected Memebers (_attribute): leading with single underscore, attributes can only be accessed in the class as well as child classes
* Private Members (__attribute): leading with double underscores, attributes can only be accessed in the class in which they were defined
"""

# a different example
class Employee:

    __company_name = 'Sabudh Foundation'
    __counter = 0 # a counter to keep a record of number of employees

    def __init__(self, name, age, employee_id):
        self.name = name
        self._age = age
        self._employee_id = employee_id

        self.__class__.__counter += 1

emp1 = Employee('Jane Doe', 30, 'EMP01')

# we can access public and protected attributes from an instance
emp1.name, emp1._age

# we cannot access a private attribute outside of it's class,
# the idea is we do not want the programmer to change this functionality,
# thus restricting them from accessing or changing this behaviour
emp1.__counter

"""### getters and setters

* Getter: a method that allows us to access an attribute in a given class
* Setter: a method that allows us to set or mutate the value of an attribute in a class

Implementing the getter and setter pattern requires:

1. Making your attributes non-public
2. Writing getter and setter methods for each attribute

"""

# a different example
class Employee:

    __company_name = 'Sabudh Foundation'
    __counter = 0 # a counter to keep a record of number of employees

    def __init__(self, name, age, employee_id):
        self.name = name
        self._age = age
        self._employee_id = employee_id

        self.__class__.__counter += 1

    @property
    def counter(self):
        return self.__class__.__counter

    @counter.setter
    def counter(self, n):
        self.__class__.__counter = n

    @property
    def company_name(self):
        return self.__class__.__company_name


emp1 = Employee('Jane Doe', 30, 'EMP01')
emp2 = Employee('John Doe', 30, 'EMP02')

# now we can access our private attribute using the getter method
print(emp1.counter, emp2.counter)

# let's use the setter method
emp1.counter = 5
print(emp1.counter, emp2.counter)

emp3 = Employee('John', 35, 'EMP03')

print(emp1.counter, emp2.counter, emp3.counter)

# let's try setting an attribute when there's only a getter method defined
emp1.company_name = 'Tatras Data'

